          // props.SetInfo({ ...props.info, i: event.target.value });
        }
      }
    }
  }

  function changeInputValueFromNumber(event) {
    for (let v = 0; v < ar1.length; v++) {
      if (props.info[ar1[v]].length !== 0) {
        if (event.target.id.toLowerCase() === Object.keys(props.info)[v]) {
          event.target.value = (
            (props.info[ar1[v]] / props.old[i]) *
